                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>Berdasarkan data sarana dan prasarana di Tempat
                                Pelelangan Ikan (TPI) KUD Mina Jaya Laksana Desa Cilamaya Girang, Kecamatan Blanakan,
                                terdapat beberapa kondisi yang dapat dianalisis:</span></p>
                        <ol style="list-style-type: decimal;margin-left: 8px;">
                            <li><strong><span style='line-height:107%;font-size:16px;'>Kondisi Baik</span></strong><span
                                    style='line-height:107%;font-size:16px;'>:</span>
                                <ul style="list-style-type: disc;">
                                    <li><span style='line-height:107%;font-size:16px;'>Tanah TPI (200 m&sup2;)</span></li>
                                    <li><span style='line-height:107%;font-size:16px;'>Bangunan TPI (200 m&sup2;)</span>
                                    </li>
                                    <li><span style='line-height:107%;font-size:16px;'>Kantor TPI (50 m&sup2;)</span></li>
                                    <li><span style='line-height:107%;font-size:16px;'>Dermaga TPI (50 m)</span></li>
                                    <li><span style='line-height:107%;font-size:16px;'>Fish basket/keranjang ikan (40
                                            buah)</span></li>
                                    <li><span style='line-height:107%;font-size:16px;'>Timbangan (2 buah)</span></li>
                                    <li><span style='line-height:107%;font-size:16px;'>Cool box</span></li>
                                </ul>
                            </li>
                        </ol>
                        <p
                            style='margin-right:0cm;margin-left:18.0pt;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>Fasilitas inti seperti tanah, bangunan, dermaga,
                                dan alat penunjang (keranjang ikan, timbangan) berada dalam kondisi baik, sehingga
                                operasional TPI secara umum bisa berjalan dengan baik. Namun, sarana penunjang seperti
                                tempat parkir, pagar pembatas, dan beberapa fasilitas lainnya tampaknya belum
                                tersedia.</span></p>
                        <ol start="2" style="list-style-type: decimal;margin-left: 8px;">
                            <li><strong><span style='line-height:107%;font-size:16px;'>Kondisi Rusak</span></strong><span
                                    style='line-height:107%;font-size:16px;'>:</span>
                                <ul style="list-style-type: disc;">
                                    <li><span style='line-height:107%;font-size:16px;'>Sarana air bersih (1 unit)</span>
                                    </li>
                                    <li><span style='line-height:107%;font-size:16px;'>Sarana MCK (1 unit)</span></li>
                                </ul>
                            </li>
                        </ol>
                        <p
                            style='margin-right:0cm;margin-left:18.0pt;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>Sarana dasar seperti air bersih dan MCK dalam
                                kondisi rusak. Ini dapat mengganggu kenyamanan dan kebersihan di area TPI, serta berpotensi
                                menurunkan kualitas layanan bagi nelayan dan pekerja.</span></p>
                        <ol start="3" style="list-style-type: decimal;margin-left: 8px;">
                            <li><span style='line-height:107%;font-size:16px;'>Beberapa fasilitas penting seperti pabrik
                                    es, SPDN (Stasiun Pengisian Diesel Nelayan), mess TPI, dan cold storage belum tersedia.
                                    Fasilitas ini sangat penting untuk mendukung kelancaran operasional, terutama dalam hal
                                    penyimpanan dan penanganan hasil tangkapan ikan.</span></li>
                            <li><span style='line-height:107%;font-size:16px;'>Sarana docking, gudang, dan klinik kesehatan
                                    juga belum ada. Keberadaan fasilitas ini akan sangat membantu dalam perawatan kapal
                                    nelayan, penyimpanan alat tangkap, dan menjaga kesehatan pekerja dan nelayan.</span>
                            </li>
                        </ol>
                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;text-indent:18.0pt;'>
                            <span style='font-size:16px;line-height:107%;'>Secara keseluruhan, TPI KUD Mina Jaya Laksana
                                memiliki sarana utama yang dalam kondisi baik, tetapi memerlukan peningkatan pada aspek
                                infrastruktur dasar dan fasilitas pendukung untuk meningkatkan efisiensi dan kualitas
                                layanan di tempat pelelangan ikan tersebut. Selain TPI KUD Mina Jaya Laksana pada data dari
                                Dinas Kelautan dan Perikanan juga tercantum kondisi dari TPI Mina Karya Baru dengan rincian
                                diantaranya adalah.</span></p>
