                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>Berdasarkan data dari KUD MINA KARYA BARU
                                mengenai sarana dan prasarana Tempat Pelelangan Ikan (TPI) tahun 2021, berikut
                                analisisnya:</span></p>
                        <div
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                            <ol style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
                                <li
                                    style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                                    <strong><span style='line-height:107%;font-size:16px;'>Kondisi Infrastruktur
                                            Fisik</span></strong><span style='line-height:107%;font-size:16px;'>:</span>
                                </li>
                            </ol>
                        </div>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Tanah
                                        dan Bangunan TPI</span></strong><span style='font-size:16px;line-height:107%;'>:
                                    Tanah TPI seluas 2400 m&sup2; dan bangunan 100 m&sup2; keduanya dalam kondisi baik,
                                    namun plafon bangunan memerlukan perbaikan. Ini menunjukkan bahwa secara struktural, TPI
                                    memiliki fasilitas yang memadai namun ada kebutuhan perawatan berkala.</span></li>
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Dermaga
                                        TPI</span></strong><span style='font-size:16px;line-height:107%;'>: Dermaga
                                    sepanjang 50 m dalam kondisi rusak. Dermaga ini penting untuk aktivitas nelayan dan
                                    rusaknya dermaga bisa menghambat operasional harian, termasuk bongkar muat ikan.</span>
                            </li>
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Tempat
                                        Parkir dan Pagar Pembatas</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Tempat parkir seluas 700 m&sup2; masih
                                    berupa tanah dan pagar pembatas sepanjang 200 m dalam kondisi baik. Fasilitas parkir
                                    yang masih berupa tanah mungkin akan bermasalah saat hujan karena bisa menjadi becek dan
                                    kurang nyaman.</span></li>
                        </ul>
                        <div
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                            <ol start="2" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
                                <li
                                    style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                                    <strong><span style='line-height:107%;font-size:16px;'>Sarana
                                            Lainnya</span></strong><span style='line-height:107%;font-size:16px;'>:</span>
                                </li>
                            </ol>
                        </div>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Sarana
                                        Air Bersih dan Sarana Ibadah: </span></strong><span
                                    style='font-size:16px;line-height:107%;'>Kedua fasilitas ini dalam kondisi baik, yang
                                    penting untuk mendukung kebersihan dan kenyamanan bagi para pekerja dan pengunjung
                                    TPI.</span></li>
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Sarana
                                        MCK: </span></strong><span style='font-size:16px;line-height:107%;'>Dua unit MCK
                                    mengalami kerusakan, yang berpotensi mempengaruhi sanitasi di area TPI, terutama bagi
                                    pekerja atau pengunjung yang memerlukan fasilitas tersebut.</span></li>
                        </ul>
                        <div
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                            <ol start="3" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
                                <li
                                    style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                                    <strong><span style='line-height:107%;font-size:16px;'>Peralatan
                                            Operasional</span></strong><span
                                        style='line-height:107%;font-size:16px;'>:</span></li>
                            </ol>
                        </div>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Fish
                                        Basket (Keranjang Ikan)</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Terdapat 40 buah dalam kondisi baik, yang
                                    menunjukkan kesiapan untuk kegiatan pelelangan atau distribusi ikan.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Timbangan</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Dari empat unit timbangan, tiga dalam
                                    kondisi baik dan satu rusak. Timbangan yang rusak bisa memengaruhi akurasi penimbangan
                                    ikan yang berdampak pada transaksi.</span></li>
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Cool
                                        Box dan Cold Storage</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Dari 12 unit cool box, hanya satu yang
                                    berfungsi baik dan dua lainnya rusak. Cold storage tidak tersedia. Kekurangan ini sangat
                                    berpengaruh pada kemampuan penyimpanan ikan dalam kondisi segar, sehingga meningkatkan
                                    risiko kerugian karena produk yang cepat membusuk.</span></li>
                        </ul>
                        <div
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                            <ol start="4" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
                                <li
                                    style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                                    <strong><span style='line-height:107%;font-size:16px;'>Ketersediaan Sarana Pendukung
                                            yang Tidak Ada</span></strong><span style='line-height:107%;font-size:16px;'>:
                                        Beberapa sarana penting seperti <strong>pabrik es, SPDN (Stasiun Pengisian Bahan
                                            Bakar Nelayan), mess untuk pekerja, balai pertemuan nelayan, gudang, bengkel,
                                            docking, klinik kesehatan</strong>, dan <strong>cold storage</strong> tidak
                                        tersedia. Tidak adanya fasilitas ini dapat menghambat kegiatan operasional yang
                                        optimal dan pengembangan jangka panjang dari TPI ini.</span></li>
                            </ol>
                        </div>
                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>Secara keseluruhan, meskipun beberapa fasilitas
                                dalam kondisi baik, ada infrastruktur penting yang rusak atau tidak tersedia, seperti
                                dermaga, sarana penyimpanan dingin, serta peralatan MCK. Ketersediaan fasilitas yang memadai
                                serta kondisi yang prima sangat penting untuk memastikan TPI beroperasi dengan efisien dan
                                mendukung kesejahteraan nelayan serta komunitas yang terlibat dalam industri perikanan.
                                Kebutuhan untuk memperbaiki dermaga, MCK, dan menambah fasilitas penyimpanan dingin harus
                                menjadi prioritas untuk memastikan kelancaran operasional. Selanjutnya untuk data Tempat
