                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>Berdasarkan data sarana dan prasarana Tempat
                                Pelelangan Ikan (TPI) <strong>KUD Mina Fajar Sidik</strong> di Desa Blanakan, berikut
                                penjelasan dari keterangan data tersebut:</span></p>
                        <div
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                            <ol style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
                                <li
                                    style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                                    <strong><span style='line-height:107%;font-size:16px;'>Kondisi Infrastruktur
                                            Fisik</span></strong><span style='line-height:107%;font-size:16px;'>:</span>
                                </li>
                            </ol>
                        </div>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Tanah
                                        dan Bangunan TPI</span></strong><span style='font-size:16px;line-height:107%;'>:
                                    Tanah seluas 2800 m&sup2; dan bangunan 1500 m&sup2; dalam kondisi baik, menunjukkan
                                    bahwa area ini memiliki ruang yang cukup luas untuk aktivitas operasional pelelangan
                                    ikan.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Dermaga TPI</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Dermaga sepanjang 100 meter mengalami
                                    kerusakan. Mengingat dermaga adalah komponen penting untuk mendukung aktivitas bongkar
                                    muat hasil tangkapan nelayan, kerusakan ini dapat berdampak signifikan pada kelancaran
                                    operasional TPI, terutama saat ada aktivitas yang melibatkan banyak perahu.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Tempat Parkir</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Dengan luas 800 m&sup2; dan telah
                                    di-hotmix, tempat parkir dalam kondisi baik, menawarkan kenyamanan bagi kendaraan yang
                                    datang ke TPI.</span></li>
                        </ul>
                        <div
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                            <ol start="2" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
                                <li
                                    style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                                    <strong><span style='line-height:107%;font-size:16px;'>Fasilitas
                                            Pendukung</span></strong><span
                                        style='line-height:107%;font-size:16px;'>:</span></li>
                            </ol>
                        </div>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Sarana Ibadah dan Sarana Air
                                        Bersih</span></strong><span style='font-size:16px;line-height:107%;'>: Kedua
                                    fasilitas ini dalam kondisi baik dan penting untuk kesejahteraan serta kenyamanan para
                                    pekerja dan nelayan di TPI.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Sarana MCK</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Dua unit sarana MCK dalam kondisi baik,
                                    yang menunjukkan bahwa sanitasi telah diperhatikan dengan baik.</span></li>
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Pos
                                        Jaga dan Balai Pertemuan Nelayan</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Fasilitas ini dalam kondisi baik dan
                                    menyediakan ruang untuk keperluan pengawasan serta pertemuan komunitas nelayan.</span>
                            </li>
                        </ul>
                        <div
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
