                                <li
                                    style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                                    <strong><span style='line-height:107%;font-size:16px;'>Peralatan
                                            Operasional</span></strong><span
                                        style='line-height:107%;font-size:16px;'>:</span></li>
                            </ol>
                        </div>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Fish
                                        Basket / Keranjang Ikan</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Terdapat 1000 buah (500 fish basket dan 500
                                    cepon), yang dalam kondisi baik, menunjukkan kesiapan yang cukup untuk menangani jumlah
                                    ikan yang masuk ke TPI.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Timbangan dan Cool
                                        Box</span></strong><span style='font-size:16px;line-height:     107%;'>: Dua unit
                                    timbangan dan sepuluh cool box dalam kondisi baik, yang akan memudahkan operasional
                                    sehari-hari terutama dalam proses penimbangan dan penyimpanan sementara ikan sebelum
                                    dijual.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Pabrik Es dan SPDN</span></strong><span
                                    style='font-size:16px;line-height:     107%;'>: TPI ini dilengkapi dengan dua unit
                                    pabrik es yang dalam kondisi baik, serta satu unit Stasiun Pengisian Bahan Bakar Nelayan
                                    (SPDN) yang juga dalam kondisi baik. Ketersediaan fasilitas ini sangat mendukung proses
                                    penyimpanan ikan agar tetap segar serta memudahkan akses bahan bakar bagi kapal
                                    nelayan.</span></li>
                        </ul>
                        <div
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                            <ol start="4" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
                                <li
                                    style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                                    <strong><span style='line-height:107%;font-size:16px;'>Ketersediaan Sarana yang Tidak
                                            Memadai</span></strong><span style='line-height:107%;font-size:16px;'>:</span>
                                </li>
                            </ol>
                        </div>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Cold
                                        Storage</span></strong><span style='font-size:16px;line-height:107%;'>: Tidak
                                    tersedia fasilitas <strong>cold storage</strong>, yang dapat mengurangi kemampuan TPI
                                    untuk menyimpan ikan dalam jumlah besar dan mempertahankannya dalam kondisi segar dalam
                                    jangka waktu yang lebih lama.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Sarana Docking</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Kondisi sarana docking dinilai kurang baik,
                                    yang mungkin akan mempersulit perawatan kapal-kapal nelayan.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Klinik Kesehatan</span></strong><span
                                    style='font-size:16px;line-height:     107%;'>: Tidak adanya klinik kesehatan dapat
                                    mempengaruhi akses cepat untuk penanganan medis darurat bagi nelayan atau pekerja yang
                                    mungkin membutuhkan pertolongan kesehatan.</span></li>
                        </ul>
                        <p
