                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>Berdasarkan data sarana dan prasarana Tempat
                                Pelelangan Ikan (TPI) <strong>KUD Mina Bahari</strong> tahun 2021 di Desa Muara, Kecamatan
                                Blanakan, berikut analisis yang dapat dilakukan:</span></p>
                        <div
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                            <ol style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
                                <li
                                    style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                                    <strong><span style='line-height:107%;font-size:16px;'>Kondisi Infrastruktur
                                            Fisik</span></strong><span style='line-height:107%;font-size:16px;'>:</span>
                                </li>
                            </ol>
                        </div>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Tanah
                                        dan Bangunan TPI</span></strong><span style='font-size:16px;line-height:107%;'>:
                                    Tanah TPI seluas 15.000 m&sup2; dengan status tanah sempadan sungai menunjukkan bahwa
                                    lokasi ini cukup strategis untuk aktivitas perikanan. Bangunan TPI seluas 900 m&sup2;
                                    dan kantor seluas 300 m&sup2; juga dalam kondisi baik, mencerminkan bahwa infrastruktur
                                    utama telah terjaga dengan baik.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Dermaga TPI</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Dermaga sepanjang 100 meter dalam kondisi
                                    baik, sangat mendukung aktivitas nelayan dalam bongkar muat hasil tangkapan.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Tempat Parkir dan Pagar
                                        Pembatas</span></strong><span style='font-size:16px;line-height:107%;'>: Tempat
                                    parkir seluas 700 m&sup2; masih sebagian berupa tanah, yang bisa menjadi masalah saat
                                    kondisi cuaca buruk seperti hujan. Pagar sepanjang 100 meter dalam kondisi baik, yang
                                    membantu dalam menjaga keamanan area TPI.</span></li>
                        </ul>
                        <div
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                            <ol start="2" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
                                <li
                                    style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                                    <strong><span style='line-height:107%;font-size:16px;'>Fasilitas
                                            Pendukung</span></strong><span
                                        style='line-height:107%;font-size:16px;'>:</span></li>
                            </ol>
                        </div>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Sarana Air Bersih</span></strong><span
                                    style='font-size:16px;line-height:     107%;'>: Tersedia satu unit sarana air bersih
                                    dalam kondisi baik, yang penting untuk mendukung kebutuhan operasional dan
                                    kebersihan.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Kios/Wasenda dan Sarana
                                        Ibadah</span></strong><span style='font-size:16px;line-height:107%;'>: Terdapat
                                    satu unit kios dalam kondisi baik, tetapi tidak ada sarana ibadah yang tersedia. Kios
                                    ini mungkin berfungsi sebagai tempat transaksi atau distribusi peralatan, namun
                                    ketiadaan sarana ibadah bisa menjadi kelemahan bagi kesejahteraan nelayan yang
                                    membutuhkan tempat beribadah di lokasi kerja.</span></li>
                        </ul>
                        <div
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                            <ol start="3" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
                                <li
                                    style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                                    <strong><span style='line-height:107%;font-size:16px;'>Peralatan
                                            Operasional</span></strong><span
                                        style='line-height:107%;font-size:16px;'>:</span></li>
                            </ol>
                        </div>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Timbangan</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Tersedia dua unit timbangan dalam kondisi
                                    baik, yang penting untuk akurasi dalam penimbangan hasil tangkapan.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Coldstorage dan Cool
                                        Box</span></strong><span style='font-size:16px;line-height:     107%;'>: Tidak ada
                                    fasilitas cold storage atau cool box yang tersedia. Ini merupakan kelemahan utama,
                                    karena tidak adanya fasilitas penyimpanan dingin dapat mempengaruhi kualitas ikan yang
                                    ditangkap, terutama jika pelelangan atau distribusi mengalami penundaan.</span></li>
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Fish
                                        Basket/Keranjang Ikan</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Tidak tersedia keranjang ikan, yang bisa
                                    menjadi kendala dalam penanganan dan distribusi ikan yang ditangkap.</span></li>
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>SPDN
                                        dan Bengkel</span></strong><span style='font-size:16px;line-height:     107%;'>:
                                    Satu unit SPDN (Stasiun Pengisian Bahan Bakar Nelayan) tersedia dan dalam kondisi baik,
                                    yang penting untuk mendukung operasional nelayan. Bengkel untuk perbaikan kapal juga
                                    tersedia, yang sangat membantu dalam perawatan dan perbaikan peralatan nelayan.</span>
                            </li>
                        </ul>
                        <div
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                            <ol start="4" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
                                <li
                                    style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                                    <strong><span style='line-height:107%;font-size:16px;'>Ketersediaan Sarana yang Tidak
                                            Ada</span></strong><span style='line-height:107%;font-size:16px;'>:</span>
                                </li>
                            </ol>
                        </div>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Cold
                                        Storage dan Docking</span></strong><span
                                    style='font-size:16px;line-height:107%;'>: Ketiadaan fasilitas cold storage dan sarana
                                    docking merupakan kelemahan signifikan. Tanpa cold storage, TPI tidak dapat menyimpan
                                    ikan dalam jumlah besar dalam kondisi segar dalam waktu lama. Ketiadaan docking juga
                                    mempengaruhi kemampuan nelayan untuk melakukan perawatan atau perbaikan kapal secara
                                    efisien.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Klinik Kesehatan</span></strong><span
                                    style='font-size:16px;line-height:     107%;'>: Tidak tersedia klinik kesehatan, yang
                                    bisa menjadi kelemahan dalam menangani keadaan darurat medis bagi nelayan dan pekerja di
                                    TPI.</span></li>
                        </ul>
                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <strong><span style='font-size:16px;line-height:107%;'>KUD Mina Bahari</span></strong><span
                                style='font-size:16px;line-height:107%;'>&nbsp;memiliki infrastruktur dasar yang memadai,
                                seperti tanah, bangunan, dermaga, SPDN, dan bengkel yang semuanya dalam kondisi baik. Namun,
                                ada beberapa kekurangan penting, seperti tidak adanya cold storage, keranjang ikan, dan cool
                                box, yang dapat menghambat efisiensi operasional dalam penyimpanan dan distribusi ikan.
                                Selain itu, ketiadaan sarana ibadah dan klinik kesehatan juga dapat mempengaruhi
                                kesejahteraan pekerja. Perbaikan yang direkomendasikan termasuk penambahan cold storage,
                                cool box, sarana docking, dan klinik kesehatan untuk mendukung kelancaran dan kenyamanan
                                operasional TPI. Data Tempat Pelelangan kelima adalah data TPI KUD Minas Saluyu Mulya,
                                dimana untuk data fasilitas dan penjelasannya telah tercantum pada tabel di bawah
                                ini.</span></p>
                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
                        <table style="border: none;width:100.0%;border-collapse:collapse;">
                            <tbody>
                                <tr>
                                    <td
                                        style="width:7.84%;border:solid windowtext 1.0pt;padding:0cm 5.4pt 0cm 5.4pt;height:30.6pt;">
