                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>Data diatas terkait sarana dan prasarana di
                                Tempat Pelelangan Ikan (TPI) KUD MINA SALUYU, Desa Mayangan, Kecamatan Legonkulon, tahun
                                2021. Berikut adalah analisa singkat berdasarkan data tersebut:</span></p>
                        <ol style="list-style-type: decimal;margin-left: 8px;">
                            <li><strong><span style='line-height:107%;font-size:16px;'>Sarana yang Kondisinya
                                        Baik</span></strong><span style='line-height:107%;font-size:16px;'>: TPI memiliki
                                    sejumlah fasilitas dalam kondisi baik seperti <strong>Tanah TPI (1200 m&sup2;)</strong>,
                                    <strong>Kantor TPI (400 m&sup2;)</strong>, <strong>Dermaga TPI (100 m&sup2;)</strong>,
                                    <strong>Sarana Air Bersih</strong>, <strong>Balai Pertemuan Nelayan</strong>,
                                    <strong>Fish Basket (40 unit)</strong>, <strong>Timbangan (2 unit)</strong>, dan
                                    <strong>Cool Box (6 unit)</strong>. Ini menunjukkan beberapa fasilitas utama TPI masih
                                    dapat berfungsi optimal untuk mendukung operasional dan kegiatan pelelangan ikan.</span>
                            </li>
                            <li><strong><span style='line-height:107%;font-size:16px;'>Sarana yang Memerlukan
                                        Perbaikan</span></strong><span style='line-height:107%;font-size:16px;'>:
                                    <strong>Bangunan TPI</strong> dengan luas 600 m&sup2; mengalami kerusakan sedang. Selain
                                    itu, <strong>Sarana MCK</strong> juga mengalami kerusakan sedang. Fasilitas ini
                                    memerlukan perbaikan agar tetap dapat digunakan secara maksimal dan tidak mengganggu
                                    aktivitas sehari-hari nelayan dan pengguna TPI.</span></li>
                            <li><strong><span style='line-height:107%;font-size:16px;'>Sarana yang Rusak Berat atau Tidak
                                        Berfungsi</span></strong><span style='line-height:107%;font-size:16px;'>:</span>
                            </li>
                        </ol>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>SPDN
                                        (Stasiun Pengisian Diesel Nelayan)</span></strong><span
                                    style='font-size:16px;line-height:107%;'>&nbsp;mengalami kerusakan berat dan tidak
                                    berfungsi. Ini bisa berdampak pada akses nelayan terhadap bahan bakar, yang esensial
                                    untuk operasional kapal mereka.</span></li>
                            <li style="text-align:justify;"><span style='font-size:16px;line-height:107%;'>Selain itu,
                                    tidak terdapat data atau informasi terkait keberadaan <strong>Pabrik Es</strong>,
                                    <strong>Coldstorage</strong>, dan <strong>Gudang</strong>, yang penting untuk rantai
                                    pendingin hasil tangkapan ikan. Ketiadaan atau kerusakan fasilitas ini dapat berdampak
                                    negatif pada kemampuan nelayan untuk menjaga kualitas ikan yang ditangkap.</span></li>
                        </ul>
                        <ol start="4" style="list-style-type: decimal;margin-left: 8px;">
                            <li><strong><span style='line-height:107%;font-size:16px;'>Sarana yang Tidak Ada atau Luas
                                        Tidak Diketahui</span></strong><span style='line-height:107%;font-size:16px;'>:
                                    Beberapa sarana seperti <strong>Pagar Pembatas</strong>, <strong>Sarana Ibadah</strong>,
                                    <strong>Kios</strong>, <strong>Mess</strong>, <strong>Pos Jaga</strong>,
                                    <strong>Bengkel</strong>, <strong>Docking</strong>, dan <strong>Klinik
                                        Kesehatan</strong> tidak memiliki informasi detail, atau mungkin belum tersedia di
                                    lokasi tersebut.</span></li>
                            <li><span style='line-height:107%;font-size:16px;'>Implikasi dan Rekomendasi:</span></li>
                        </ol>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
