                                            style='line-height:107%;font-size:16px;'>&nbsp;dengan luas 200 m&sup2; dalam
                                            kondisi baik. Namun, tanah tersebut berstatus milik Perhutani, bukan milik KUD,
                                            sehingga bisa mempengaruhi stabilitas operasional jangka panjang.</span></li>
                                    <li><strong><span
                                                style='line-height:107%;font-size:16px;'>Timbangan</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;(1 unit) masih dalam kondisi
                                            baik, yang penting untuk aktivitas pelelangan dan penentuan harga ikan.</span>
                                    </li>
