                                        Perbaikan:</span></strong>
                                <ul style="list-style-type: disc;">
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Bangunan
                                                TPI</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;dan <strong>Kantor TPI</strong>
                                            masing-masing seluas 100 m&sup2; mengalami kerusakan sedang. Hal ini bisa
                                            mengganggu kelancaran operasional dan harus diperbaiki untuk menjaga fungsi
                                            manajemen dan administrasi.</span></li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Fish Basket (Keranjang
                                                Ikan)</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;yang hanya berjumlah 4 unit
                                            dalam kondisi rusak, yang akan mempengaruhi efisiensi pengumpulan ikan.</span>
                                    </li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Cool Box (2
                                                unit)</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;juga rusak, yang berpotensi
                                            memengaruhi penyimpanan ikan dalam kondisi segar, terutama ketika hasil
                                            tangkapan melimpah.</span></li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Sarana Air
                                                Bersih</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;dan <strong>Sarana MCK</strong>
                                            mengalami kerusakan berat. Ini merupakan masalah serius karena air bersih dan
                                            fasilitas MCK sangat penting untuk mendukung kebersihan dan kesehatan di
                                            TPI.</span></li>
                                </ul>
                            </li>
                            <li><strong><span style='line-height:107%;font-size:16px;'>Sarana yang Tidak Ada atau Tidak
                                        Berfungsi</span></strong>
                                <ul style="list-style-type: disc;">
                                    <li><span style='line-height:107%;font-size:16px;'>Tidak ada <strong>Dermaga</strong>,
                                            <strong>Tempat Parkir</strong>, <strong>Pagar Pembatas</strong>, dan
                                            <strong>Pabrik Es</strong>, yang seharusnya merupakan fasilitas penting untuk
                                            mendukung operasional yang lebih efisien.</span></li>
                                    <li><span style='line-height:107%;font-size:16px;'>Fasilitas lain yang tidak tersedia
                                            atau belum dibangun mencakup <strong>Mess TPI</strong>, <strong>Balai Pertemuan
                                                Nelayan</strong>, <strong>Pos Jaga</strong>, <strong>Coldstorage</strong>,
                                            <strong>Bengkel</strong>, <strong>Gudang</strong>, dan <strong>Klinik
                                                Kesehatan</strong>. Ketiadaan fasilitas ini bisa mengurangi kualitas layanan
                                            kepada nelayan dan masyarakat sekitar.</span></li>
                                </ul>
                            </li>
                            <li><strong><span style='line-height:107%;font-size:16px;'>Implikasi
                                        Operasional:</span></strong>
                                <ul style="list-style-type: disc;">
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Kondisi Infrastruktur yang
                                                Buruk</span></strong><span style='line-height:107%;font-size:16px;'>:
                                            Sebagian besar sarana di TPI ini dalam kondisi rusak atau tidak tersedia. Hal
                                            ini dapat memengaruhi operasional harian, terutama terkait dengan penyimpanan
                                            dan pengolahan ikan. Ketiadaan fasilitas dermaga juga bisa mempersulit proses
                                            bongkar muat hasil tangkapan.</span></li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Kurangnya Fasilitas
                                                Penting</span></strong><span style='line-height:107%;font-size:16px;'>:
                                            Tidak adanya fasilitas penting seperti coldstorage dan pabrik es bisa menghambat
                                            pengelolaan rantai pasokan dingin, yang esensial untuk menjaga kualitas ikan.
                                            Selain itu, ketiadaan klinik kesehatan juga bisa membahayakan kesejahteraan
                                            pekerja.</span></li>
                                </ul>
                            </li>
                            <li><strong><span style='line-height:107%;font-size:16px;'>Rekomendasi:</span></strong>
                                <ul style="list-style-type: disc;">
                                    <li><span style='line-height:107%;font-size:16px;'>Perbaikan segera harus dilakukan
                                            terhadap sarana yang rusak seperti bangunan TPI, kantor, sarana MCK, dan sarana
                                            air bersih untuk menjaga operasional yang layak.</span></li>
                                    <li><span style='line-height:107%;font-size:16px;'>Pengadaan fasilitas penting seperti
                                            dermaga, coldstorage, dan pabrik es akan sangat membantu meningkatkan efisiensi
                                            dan produktivitas kegiatan pelelangan dan penyimpanan hasil laut.</span></li>
                                    <li><span style='line-height:107%;font-size:16px;'>Pertimbangkan untuk melakukan kerja
                                            sama dengan pihak terkait (seperti Perhutani) untuk menyelesaikan isu
                                            kepemilikan tanah dan meningkatkan status kepemilikan fasilitas yang
                                            strategis.</span></li>
                                </ul>
                            </li>
                        </ol>
