                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
                        <div
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                            <ol style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
                                <li
                                    style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
                                    <strong><span style='line-height:107%;font-size:16px;'>Sarana dengan Kondisi
                                            Baik:</span></strong></li>
                            </ol>
                        </div>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span style='font-size:16px;line-height:107%;'>Tanah
                                        TPI</span></strong><span style='font-size:16px;line-height:107%;'>&nbsp;(15.000
                                    m&sup2;) dalam kondisi baik, dengan status tanah milik KUD/adat, yang memberikan
                                    kestabilan jangka panjang untuk operasi TPI.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Bangunan TPI</span></strong><span
                                    style='font-size:16px;line-height:107%;'>&nbsp;(400 m&sup2;), <strong>Kantor
                                        TPI</strong> (300 m&sup2;), dan <strong>Tempat Parkir</strong> (600 m&sup2;, sudah
                                    diaspal hotmix) juga dalam kondisi baik, memberikan dukungan infrastruktur penting untuk
                                    operasional.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Sarana Air Bersih</span></strong><span
                                    style='font-size:16px;line-height:     107%;'>&nbsp;(1 unit) dan <strong>Balai
                                        Pertemuan Nelayan</strong> (1 unit) dalam kondisi baik, menunjukkan bahwa kebutuhan
                                    dasar seperti air dan ruang pertemuan tersedia dengan baik.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Kios/Wasenda</span></strong><span
                                    style='font-size:16px;line-height:107%;'>&nbsp;(10 unit) dalam kondisi baik, yang
                                    penting sebagai sarana perdagangan di sekitar TPI.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Timbangan</span></strong><span
                                    style='font-size:16px;line-height:107%;'>&nbsp;dalam kondisi baik, memastikan
                                    penimbangan hasil tangkapan dapat dilakukan secara akurat.</span></li>
                        </ul>
                        <ol start="2" style="list-style-type: decimal;margin-left: 8px;">
                            <li><strong><span style='line-height:107%;font-size:16px;'>Sarana yang Memerlukan
                                        Perbaikan:</span></strong>
                                <ul style="list-style-type: disc;">
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Dermaga
                                                TPI</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;(30 meter) mengalami
                                            <strong>kerusakan berat</strong>, yang bisa menghambat aktivitas bongkar muat
                                            kapal nelayan dan mempengaruhi efisiensi operasional.</span></li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>SPDN (Stasiun Pengisian
                                                Diesel Nelayan)</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;dalam kondisi <strong>rusak
                                                sedang</strong>, yang bisa mengurangi akses nelayan terhadap bahan bakar
                                            kapal.</span></li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Sarana
                                                MCK</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;(1
                                            unit) mengalami <strong>kerusakan sedang</strong>, yang penting diperbaiki agar
                                            kebutuhan kebersihan nelayan dan pekerja TPI tetap terjaga.</span></li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Fish Basket/Keranjang
                                                Ikan/Cepon</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;dalam kondisi <strong>rusak
                                                sedang</strong>, yang bisa memengaruhi kelancaran penanganan hasil
                                            tangkapan.</span></li>
                                </ul>
                            </li>
                            <li><strong><span style='line-height:107%;font-size:16px;'>Sarana yang Tidak Ada atau Tidak
                                        Berfungsi:</span></strong>
                                <ul style="list-style-type: disc;">
                                    <li><span style='line-height:107%;font-size:16px;'>Beberapa fasilitas penting seperti
                                            <strong>Pagar Pembatas</strong>, <strong>Pabrik Es</strong>,
                                            <strong>Coldstorage</strong>, <strong>Bengkel</strong>, <strong>Sarana
                                                Docking</strong>, <strong>Gudang</strong>, dan <strong>Klinik
                                                Kesehatan</strong> tidak tersedia. Ini dapat menghambat pengelolaan rantai
                                            pasokan dingin, perawatan kapal, serta penyimpanan hasil tangkapan yang
                                            memadai.</span></li>
                                    <li><span style='line-height:107%;font-size:16px;'>Tidak adanya <strong>Mess
                                                TPI</strong> dan <strong>Sarana Ibadah</strong> juga mengurangi kenyamanan
                                            pekerja dan pengguna TPI, terutama bagi mereka yang tinggal atau bekerja dalam
                                            jangka waktu lama di area tersebut.</span></li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Cool
                                                Box</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;juga tidak tersedia, yang
                                            penting untuk penyimpanan ikan sementara setelah tangkapan.</span></li>
                                </ul>
                            </li>
                            <li><strong><span style='line-height:107%;font-size:16px;'>Analisis Kebutuhan dan Implikasi
                                        Operasional:</span></strong></li>
                        </ol>
                        <ul style="margin-bottom:0cm;margin-top:0cm;" type="disc">
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Infrastruktur penting yang
                                        rusak</span></strong><span style='font-size:16px;line-height:107%;'>&nbsp;seperti
                                    dermaga dan SPDN perlu segera diperbaiki agar operasi bongkar muat dan pengisian bahan
                                    bakar dapat berjalan lancar. Kondisi dermaga yang rusak berat bisa memperlambat atau
                                    bahkan menghentikan operasi kapal nelayan.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Kurangnya fasilitas penyimpanan
                                        dingin</span></strong><span style='font-size:16px;line-height:107%;'>&nbsp;seperti
                                    pabrik es dan coldstorage akan mengurangi kemampuan nelayan dan KUD untuk menjaga
                                    kualitas ikan, yang penting untuk pemasaran.</span></li>
                            <li style="text-align:justify;"><strong><span
                                        style='font-size:16px;line-height:107%;'>Fasilitas pendukung
                                        lain</span></strong><span
                                    style='font-size:16px;line-height:     107%;'>&nbsp;seperti bengkel dan gudang
                                    diperlukan untuk memastikan kelancaran operasional, terutama dalam hal perawatan
                                    peralatan dan penyimpanan barang-barang terkait aktivitas TPI.</span></li>
                        </ul>
                        <ol start="5" style="list-style-type: decimal;margin-left: 8px;">
                            <li><strong><span style='line-height:107%;font-size:16px;'>Rekomendasi:</span></strong>
                                <ul style="list-style-type: disc;">
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Perbaikan sarana
                                                rusak</span></strong><span style='line-height:107%;font-size:16px;'>:
                                            Dermaga TPI dan SPDN memerlukan perbaikan segera karena langsung berhubungan
                                            dengan kegiatan nelayan sehari-hari.</span></li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Pengadaan fasilitas
                                                tambahan</span></strong><span style='line-height:107%;font-size:16px;'>:
                                            Coldstorage dan pabrik es sangat diperlukan untuk menjaga kualitas hasil
                                            tangkapan. Sarana lain seperti pagar pembatas, mess, bengkel, dan gudang juga
                                            penting untuk mendukung kelancaran operasional TPI secara keseluruhan.</span>
                                    </li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Peningkatan infrastruktur
                                                kebersihan</span></strong><span style='line-height:107%;font-size:16px;'>:
                                            Sarana MCK yang rusak harus segera diperbaiki untuk menjaga kebersihan dan
                                            kenyamanan di area TPI.</span></li>
                                </ul>
                            </li>
                        </ol>
                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>KUD Mina Misaya memiliki beberapa infrastruktur
                                yang penting dalam kondisi baik, namun terdapat fasilitas yang rusak dan beberapa sarana
                                penting yang belum ada. Perbaikan dan pengadaan sarana tambahan sangat diperlukan untuk
                                meningkatkan efisiensi operasional dan mendukung kesejahteraan nelayan. Pelabuhan atau TPI
                                terakhir adalah TPI KUD Mina Tanung Mataram&nbsp;</span></p>
