                                        style="width: 11.36%;border-top: 1pt solid windowtext;border-right: 1pt solid windowtext;border-bottom: 1pt solid windowtext;border-image: initial;border-left: none;padding: 0cm 5.4pt;height: 1pt;vertical-align: bottom;">
                                        <p
                                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:.0001pt;font-size:11.0pt;text-align:center;line-height:normal;'>
