                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
                        <ol style="list-style-type: decimal;margin-left: 8px;">
                            <li><strong><span style='line-height:107%;font-size:16px;'>Kondisi Aset Fisik</span></strong>
                                <ul style="list-style-type: disc;">
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Tanah TPI (1000 m&sup2;,
                                                Baik)</span></strong><span style='line-height:107%;font-size:16px;'>:
                                            Status tanah sebagai milik KUD/adat memberikan kestabilan jangka panjang dalam
                                            pengelolaan. Tanah yang luas memberikan fleksibilitas untuk pengembangan lebih
                                            lanjut, seperti pembangunan fasilitas penunjang yang saat ini belum ada.</span>
                                    </li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Bangunan TPI (150 m&sup2;,
                                                Baik)</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;dan <strong>Kantor TPI (50
                                                m&sup2;, Baik)</strong>: Keduanya berfungsi dengan baik, yang menunjukkan
                                            bahwa aktivitas pelelangan dan administrasi berjalan lancar. Namun, ukuran
                                            bangunan dan kantor yang relatif kecil mungkin dapat menjadi kendala jika volume
                                            aktivitas pelelangan meningkat di masa depan.</span></li>
                                </ul>
                            </li>
                            <li><strong><span style='line-height:107%;font-size:16px;'>Kondisi Infrastruktur
                                        Penunjang</span></strong>
                                <ul style="list-style-type: disc;">
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Dermaga
                                                TPI</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;(50 m, Rusak Sedang): Dermaga
                                            adalah komponen penting untuk aktivitas bongkar muat ikan. Kondisi rusak sedang
                                            berpotensi menyebabkan risiko keselamatan bagi nelayan dan merusak kualitas ikan
                                            akibat waktu bongkar yang lebih lama. Ini dapat mempengaruhi efisiensi
                                            operasional dan daya saing TPI dibandingkan dengan TPI lain yang memiliki
                                            dermaga yang lebih baik. Perbaikan dermaga harus diprioritaskan untuk
                                            meningkatkan aksesibilitas kapal dan memperlancar rantai pasok.</span></li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Tempat
                                                Parkir</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;(500 m&sup2;, Baik): Tempat
                                            parkir yang cukup luas dan dalam kondisi baik mendukung kelancaran lalu lintas
                                            kendaraan yang mengangkut hasil pelelangan, namun status tanah yang masih berupa
                                            tanah (belum diaspal atau dipaving) dapat menimbulkan masalah seperti becek saat
                                            musim hujan, yang mempengaruhi kenyamanan dan efektivitas.</span></li>
                                </ul>
                            </li>
                            <li><strong><span style='line-height:107%;font-size:16px;'>Fasilitas Pendukung yang
                                        Minim</span></strong>
                                <ul style="list-style-type: disc;">
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Pabrik Es (0 unit), Cold
                                                Storage (0 unit), dan SPDN (0 unit):</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;Tidak tersedianya fasilitas
                                            pengolahan dan penyimpanan seperti pabrik es dan cold storage menjadi tantangan
                                            besar. Fasilitas ini krusial untuk mempertahankan kualitas ikan sebelum dijual,
                                            terutama di sektor perikanan yang mengandalkan rantai pendingin. Tanpa fasilitas
                                            ini, potensi nilai jual ikan bisa menurun, yang akhirnya merugikan nelayan
                                            karena harga jual ikan tidak maksimal.</span></li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>SPDN (Stasiun Pengisian
                                                Diesel Nelayan)</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;yang tidak tersedia juga
                                            mengindikasikan nelayan harus mendapatkan bahan bakar dari luar, yang bisa
                                            menambah biaya operasional nelayan dan mengurangi efisiensi perjalanan melaut
                                            mereka.</span></li>
                                </ul>
                            </li>
                            <li><strong><span style='line-height:107%;font-size:16px;'>Kekurangan Fasilitas
                                        Lainnya</span></strong>
                                <ul style="list-style-type: disc;">
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Mess, Balai Pertemuan
                                                Nelayan, dan Pos Jaga (0 Unit atau Tidak Tersedia):</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;Tidak tersedianya mess bagi
                                            nelayan atau pekerja, dan minimnya sarana lain seperti pos jaga dapat berakibat
                                            kurangnya fasilitas kenyamanan bagi para pekerja. Balai Pertemuan Nelayan yang
                                            ada dalam kondisi baik, namun kemungkinan kurangnya sarana sosialisasi atau
                                            komunikasi secara rutin di luar jam kerja bisa menghambat koordinasi dan
                                            pembangunan kapasitas nelayan.</span></li>
                                    <li><strong><span style='line-height:107%;font-size:16px;'>Bengkel dan Gudang (0
                                                unit):</span></strong><span
                                            style='line-height:107%;font-size:16px;'>&nbsp;Ketiadaan bengkel atau gudang
                                            untuk penyimpanan alat-alat melaut serta pemeliharaan kapal dan peralatan
                                            perikanan juga menjadi kelemahan signifikan. Nelayan harus mencari tempat lain
                                            untuk memperbaiki kapal atau menyimpan peralatan mereka, yang meningkatkan biaya
                                            dan waktu operasional.</span></li>
                                </ul>
                            </li>
                            <li><strong><span style='line-height:107%;font-size:16px;'>Sarana MCK dan Air Bersih
                                        (Baik):</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Adanya
                                    fasilitas MCK dan air bersih dalam kondisi baik merupakan poin positif, karena hal ini
                                    memastikan kebersihan dan sanitasi di area pelelangan. Ini penting bagi kesehatan para
                                    pekerja dan juga untuk menjaga standar higienitas produk ikan yang dilelang. Namun,
                                    ketiadaan klinik kesehatan (0 unit) merupakan kekurangan yang bisa menjadi kendala dalam
                                    hal penanganan cedera atau masalah kesehatan nelayan secara langsung di lokasi
                                    kerja.</span></li>
                            <li><strong><span style='line-height:107%;font-size:16px;'>Timbangan dan Fish Basket
                                        (Baik):</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Adanya
                                    timbangan dan keranjang ikan yang berfungsi baik menunjukkan bahwa TPI ini mampu
                                    menjalankan aktivitas operasional pelelangan dengan efisien. Timbangan berfungsi sebagai
                                    alat penting untuk menentukan nilai jual ikan dengan tepat, sedangkan fish basket
                                    mempermudah penanganan ikan.</span></li>
                        </ol>
                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>Secara keseluruhan, meskipun fasilitas utama
                                dalam kondisi baik, TPI di bawah KUD Tanjung Mataram menghadapi tantangan besar dalam hal
                                infrastruktur pendukung yang minim. Fasilitas seperti dermaga, cold storage, pabrik es,
                                SPDN, serta bengkel sangat penting untuk meningkatkan daya saing dan kualitas layanan TPI.
                                Tanpa perbaikan dan penyediaan fasilitas tersebut, potensi nilai tambah dari hasil tangkapan
                                nelayan sulit untuk dioptimalkan, sehingga bisa berdampak negatif pada pendapatan nelayan
                                dan keberlanjutan usaha.</span></p>
                        <p
                            style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'>
                            <span style='font-size:16px;line-height:107%;'>Untuk meningkatkan kapasitas TPI dan
                                kesejahteraan nelayan, KUD perlu mempertimbangkan investasi atau kolaborasi dengan pihak
                                lain untuk menyediakan fasilitas yang saat ini belum tersedia, sekaligus memperbaiki sarana
                                yang rusak. Peningkatan fasilitas juga dapat membuka peluang lebih luas dalam perdagangan
                                ikan yang berkualitas lebih tinggi dan efisiensi rantai pasok.</span></p>
                        <p><span style='font-size:16px;'><br>&nbsp;</span></p>
                    </div>

                    <div class="tab-pane fade" id="potensipeternakan" role="tabpanel" aria-labelledby="profile-tab">
                        <p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Potensi peternakan di Kabupaten Subang, Jawa Barat, sangat besar dan memiliki prospek yang menjanjikan. Beberapa faktor mendukung perkembangan sektor peternakan di wilayah ini, baik dari segi geografis, sumber daya alam, infrastruktur, serta dukungan pemerintah daerah. Berikut adalah analisis potensi peternakan di Kabupaten Subang secara lebih panjang dan lengkap:</span></p>
<div style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
    <ol start="4" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
        <li style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'><strong><span style='line-height:107%;font-size:16px;'>Kondisi Geografis dan Iklim</span></strong></li>
    </ol>
</div>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Kabupaten Subang memiliki wilayah yang bervariasi, mulai dari dataran rendah hingga pegunungan, dengan iklim tropis yang mendukung kegiatan pertanian dan peternakan. Beberapa faktor yang menjadikan Subang cocok untuk peternakan antara lain:</span></p>
<ul class="decimal_type" style="list-style-type: disc;margin-left: 8px;">
    <li><strong><span style='line-height:107%;font-size:16px;'>Ketinggian wilayah</span></strong><span style='line-height:107%;font-size:16px;'>: Subang memiliki daerah dengan ketinggian yang cukup untuk mendukung peternakan sapi perah, domba, kambing, dan unggas. Ketinggian yang lebih tinggi umumnya memiliki suhu yang lebih sejuk, sehingga ideal untuk ternak yang membutuhkan iklim lebih dingin, seperti sapi perah.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Curah hujan yang cukup</span></strong><span style='line-height:107%;font-size:16px;'>: Curah hujan yang memadai di Kabupaten Subang memungkinkan tersedianya sumber air yang baik untuk kegiatan peternakan. Ketersediaan air yang baik penting untuk kebutuhan pakan hijauan, minum ternak, dan sanitasi peternakan.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Lahan yang luas</span></strong><span style='line-height:107%;font-size:16px;'>: Subang memiliki lahan pertanian yang cukup luas, yang dapat dimanfaatkan untuk pengembangan pakan ternak maupun peternakan intensif. Ketersediaan lahan untuk peternakan di Subang memberikan keuntungan bagi pengusaha yang ingin mengembangkan usaha feedlot atau pembiakan ternak.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Komoditas Peternakan Utama</span></strong></li>
</ul>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Kabupaten Subang memiliki potensi besar dalam berbagai jenis komoditas peternakan. Berikut ini adalah komoditas peternakan utama yang berpotensi dikembangkan di Subang:</span></p>
<ol class="decimal_type" style="list-style-type: decimal;margin-left: 8px;">
    <li><strong><span style='line-height:107%;font-size:16px;'>Sapi Perah</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Sapi perah adalah salah satu komoditas peternakan unggulan di Subang, terutama di daerah pegunungan yang memiliki suhu sejuk dan sumber pakan hijauan yang melimpah. Peternakan sapi perah di Subang dapat menghasilkan susu segar yang kemudian diolah menjadi produk turunan seperti keju, yoghurt, dan susu pasteurisasi. Beberapa faktor yang mendukung pengembangan sapi perah di Subang antara lain:</span>
        <ol style="list-style-type: circle;">
            <li><strong><span style='line-height:107%;font-size:16px;'>Pasar yang besar</span></strong><span style='line-height:107%;font-size:16px;'>: Subang berdekatan dengan kota-kota besar seperti Bandung dan Jakarta, yang merupakan pasar utama produk susu segar.</span></li>
            <li><strong><span style='line-height:107%;font-size:16px;'>Dukungan pemerintah</span></strong><span style='line-height:107%;font-size:16px;'>: Pemerintah Kabupaten Subang mendorong pengembangan peternakan sapi perah dengan program pelatihan dan bantuan teknologi untuk meningkatkan produktivitas susu.</span></li>
            <li><strong><span style='line-height:107%;font-size:16px;'>Koperasi peternak</span></strong><span style='line-height:107%;font-size:16px;'>: Adanya koperasi peternak sapi perah di Subang membantu meningkatkan daya saing produk susu lokal di pasar nasional, dengan fokus pada kualitas dan volume produksi.</span></li>
        </ol>
    </li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Sapi Potong</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Selain sapi perah, peternakan sapi potong juga berpotensi besar di Subang. Sistem penggemukan sapi (feedlot) sangat cocok dikembangkan di daerah ini, mengingat ketersediaan pakan hijauan yang melimpah serta infrastruktur jalan yang memadai untuk distribusi daging sapi. Peternakan sapi potong di Subang dapat mendukung pemenuhan kebutuhan daging sapi di wilayah Jawa Barat, terutama dengan meningkatnya konsumsi daging di kota-kota besar.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Domba dan Kambing</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Peternakan domba dan kambing juga merupakan komoditas penting di Subang, dengan potensi besar untuk memenuhi kebutuhan lokal maupun regional. Domba dan kambing mudah beradaptasi dengan kondisi geografis Subang yang bervariasi, serta permintaan yang tinggi untuk kebutuhan aqiqah, kurban, dan konsumsi sehari-hari. Beberapa keunggulan dalam mengembangkan peternakan domba dan kambing di Subang antara lain:</span>
        <ol style="list-style-type: circle;">
            <li><strong><span style='line-height:107%;font-size:16px;'>Pertumbuhan populasi domba dan kambing yang cepat</span></strong><span style='line-height:107%;font-size:16px;'>: Domba dan kambing memiliki siklus reproduksi yang singkat, sehingga dapat berkembang biak dengan cepat dan meningkatkan populasi ternak dalam waktu relatif singkat.</span></li>
            <li><strong><span style='line-height:107%;font-size:16px;'>Pasar yang luas</span></strong><span style='line-height:107%;font-size:16px;'>: Selain untuk memenuhi kebutuhan lokal, produk domba dan kambing dari Subang juga dapat dipasarkan ke daerah lain di Jawa Barat dan Jakarta, terutama pada momen-momen keagamaan seperti Idul Adha.</span></li>
        </ol>
    </li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Unggas</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Unggas, terutama ayam broiler dan petelur, juga merupakan sektor peternakan yang potensial di Subang. Dengan peningkatan permintaan terhadap daging ayam dan telur, pengembangan peternakan unggas memiliki prospek yang baik di wilayah ini. Selain itu, Subang memiliki akses ke jalur distribusi yang baik untuk mengirimkan produk unggas ke pasar-pasar besar di Jawa Barat dan Jakarta.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Peternakan Bebek</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Bebek adalah komoditas lain yang berpotensi di Subang, khususnya di daerah yang dekat dengan lahan basah atau sawah. Bebek dapat dibudidayakan untuk diambil daging dan telurnya, dengan pasar yang cukup luas baik untuk konsumsi domestik maupun untuk memenuhi permintaan restoran atau industri makanan. Bebek merupakan sumber protein alternatif yang semakin populer di kalangan konsumen Indonesia.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Faktor Pendukung Pengembangan Peternakan di Subang</span></strong></li>
</ol>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Selain kondisi geografis yang mendukung, terdapat beberapa faktor lain yang memberikan keuntungan bagi pengembangan sektor peternakan di Kabupaten Subang:</span></p>
<ol class="decimal_type" style="list-style-type: decimal;margin-left: 8px;">
    <li><strong><span style='line-height:107%;font-size:16px;'>Infrastruktur Transportasi</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Kabupaten Subang memiliki jaringan infrastruktur transportasi yang baik, termasuk akses ke jalan utama yang menghubungkan Subang dengan kota-kota besar seperti Bandung dan Jakarta. Hal ini sangat penting dalam mendukung distribusi hasil peternakan, baik itu daging, susu, telur, maupun produk turunan lainnya. Pembangunan infrastruktur seperti Pelabuhan Patimban juga memberikan peluang ekspor bagi produk peternakan dari Subang.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Dukungan Pemerintah dan Program Pengembangan</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Pemerintah Kabupaten Subang telah menunjukkan komitmennya untuk mengembangkan sektor peternakan melalui berbagai program bantuan dan pelatihan bagi peternak lokal. Beberapa program meliputi:</span>
        <ol style="list-style-type: circle;">
            <li><strong><span style='line-height:107%;font-size:16px;'>Bantuan bibit ternak</span></strong><span style='line-height:107%;font-size:16px;'>: Pemerintah daerah memberikan bantuan bibit ternak berkualitas untuk meningkatkan populasi ternak dan produktivitas peternak lokal.</span></li>
            <li><strong><span style='line-height:107%;font-size:16px;'>Pelatihan dan edukasi peternak</span></strong><span style='line-height:107%;font-size:16px;'>: Program pelatihan teknis bagi peternak mengenai manajemen peternakan, kesehatan ternak, hingga teknologi peternakan modern.</span></li>
            <li><strong><span style='line-height:107%;font-size:16px;'>Fasilitasi akses pasar</span></strong><span style='line-height:107%;font-size:16px;'>: Pemerintah Subang juga bekerja untuk membuka akses pasar yang lebih luas bagi peternak lokal melalui program promosi dan kerja sama dengan pelaku industri.</span></li>
        </ol>
    </li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Ketersediaan Pakan</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Subang memiliki sumber daya alam yang kaya, termasuk ketersediaan pakan hijauan yang melimpah. Lahan pertanian di Subang banyak yang digunakan untuk produksi pakan ternak, baik berupa rumput, jagung, ataupun bahan pakan lainnya. Ketersediaan pakan yang baik menjadi faktor kunci dalam pengembangan peternakan yang berkelanjutan, karena pakan merupakan komponen biaya terbesar dalam usaha peternakan.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Koperasi dan Kemitraan</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Peran koperasi dan kemitraan antara peternak lokal dengan perusahaan besar atau pelaku industri juga menjadi faktor penting dalam pengembangan peternakan di Subang. Koperasi membantu peternak kecil untuk bersaing di pasar yang lebih besar melalui pengumpulan hasil ternak, negosiasi harga, serta pemasaran yang lebih efektif. Selain itu, kemitraan dengan perusahaan besar dapat memberikan akses kepada teknologi, modal, dan pasar yang lebih luas.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Tantangan dan Peluang</span></strong></li>
</ol>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Meskipun memiliki potensi besar, pengembangan sektor peternakan di Kabupaten Subang juga dihadapkan pada beberapa tantangan yang perlu diatasi. Tantangan-tantangan tersebut meliputi:</span></p>
<ul style="list-style-type: disc;margin-left: 8px;">
    <li><strong><span style='line-height:107%;font-size:16px;'>Penyakit ternak</span></strong><span style='line-height:107%;font-size:16px;'>: Penyakit pada ternak, terutama penyakit menular, dapat menjadi ancaman serius bagi keberlanjutan usaha peternakan. Oleh karena itu, peternak perlu menerapkan manajemen kesehatan ternak yang baik dan bekerja sama dengan dinas terkait untuk pengendalian penyakit.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Fluktuasi harga komoditas</span></strong><span style='line-height:107%;font-size:16px;'>: Harga daging, susu, dan produk ternak lainnya sering kali berfluktuasi, terutama dipengaruhi oleh faktor musiman, permintaan pasar, dan kebijakan pemerintah. Peternak di Subang perlu memperkuat manajemen keuangan dan produksi agar dapat bertahan dalam kondisi pasar yang tidak stabil.</span></li>
</ul>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Namun, peluang pengembangan sektor peternakan di Subang sangat besar, terutama dengan adanya dukungan pemerintah, infrastruktur yang berkembang, serta permintaan pasar yang terus meningkat. Subang dapat menjadi salah satu sentra peternakan utama di Jawa Barat dan nasional jika potensi ini dapat dimanfaatkan secara optimal. Tim UPTD PPP Pelabuhan Laut telah melakukan survei terkait potensi dari Peternakan untuk peningkatan fungsi Pelabuhan di Kabupaten Subang berikut data dimaksud.</span></p>
