<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Untuk memahami lebih baik dinamika dan struktur industri peternakan di Indonesia, kita perlu menelaah jenis-jenis usaha yang dioperasikan oleh perusahaan-perusahaan dalam daftar ini, komoditas yang diproduksi, serta pola diversifikasi usaha yang dilakukan oleh mereka. Dengan melihat dari sudut pandang ekonomi, bisnis, dan strategi pemasaran, kita dapat mengidentifikasi tren, peluang, serta tantangan yang dihadapi sektor ini.</span></p>
<div style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'>
    <ol start="4" style="margin-bottom:0cm;list-style-type: decimal;margin-left: 8px;">
        <li style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;'><strong><span style='line-height:107%;font-size:16px;'>Jenis-Jenis Usaha yang Dioperasikan</span></strong></li>
    </ol>
</div>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Dokumen ini menunjukkan bahwa terdapat beberapa jenis usaha utama yang dijalankan oleh perusahaan di industri peternakan Indonesia, yaitu:</span></p>
<ol class="decimal_type" style="list-style-type: decimal;margin-left: 8px;">
    <li><strong><span style='line-height:107%;font-size:16px;'>Breeding Farm/Hatchery</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Breeding farm atau usaha peternakan untuk pembiakan dan hatchery, yang mengacu pada penetasan telur unggas atau bebek, adalah jenis usaha yang dominan dalam daftar ini. Perusahaan-perusahaan seperti PT. Charoen Pokphand Indonesia, PT. Japfa Comfeed Indonesia, dan PT. Malindo Feedmill Tbk, semuanya terlibat dalam usaha pembiakan unggas, khususnya ayam, yang menghasilkan DOC (Day-Old Chick). Usaha hatchery sangat vital karena memastikan ketersediaan pasokan anak unggas yang kemudian dibesarkan untuk kebutuhan daging atau telur. Permintaan terhadap anak ayam (DOC) ini terus meningkat, terutama karena konsumsi daging unggas yang cenderung meningkat secara global, termasuk di Indonesia.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Broiler</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Broiler atau penggemukan unggas untuk dipanen dagingnya adalah usaha lain yang juga banyak ditemukan dalam daftar ini. Perusahaan seperti PT. Sarana Proteindo Utama dan PT. Ciomas Adisatwa bergerak dalam bidang broiler. Ayam broiler adalah salah satu komoditas unggulan di Indonesia karena daging ayam merupakan sumber protein hewani yang paling banyak dikonsumsi oleh masyarakat. Dalam bisnis broiler, perusahaan umumnya memelihara ayam dari fase anakan (DOC) hingga siap potong, kemudian dipasarkan sebagai daging segar atau olahan. Salah satu tantangan dalam usaha broiler adalah pengelolaan penyakit pada unggas, yang memerlukan manajemen yang ketat dalam aspek biosekuriti.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>RPU (Rumah Pemotongan Unggas)</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Sebagian perusahaan dalam daftar ini juga mengoperasikan RPU atau Rumah Pemotongan Unggas, seperti PT. Charoen Pokphand Indonesia. RPU merupakan bagian integral dari rantai pasokan daging unggas, di mana unggas yang telah siap dipotong diolah menjadi karkas untuk kemudian dijual kepada konsumen. Industri pemotongan unggas ini membutuhkan investasi besar dalam infrastruktur dan teknologi untuk memastikan kualitas daging yang dihasilkan tetap higienis dan memenuhi standar kesehatan yang ketat.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Feedloter (Penggemukan Sapi)</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Sapi potong dan sapi perah juga menjadi fokus utama dari beberapa perusahaan dalam dokumen ini. Feedloter adalah sistem penggemukan sapi secara intensif, di mana sapi dipelihara dengan pemberian pakan berkualitas untuk meningkatkan berat badan dan kualitas dagingnya. PT. Global Dairi Alami, PT. Hade Dinamis Sejahtera, dan PT. Estika Tata Tiara adalah contoh perusahaan yang terlibat dalam feedlot sapi potong. Penggemukan sapi potong memerlukan waktu, biaya, dan teknologi yang besar untuk memaksimalkan kualitas daging serta efisiensi proses produksi. Dalam feedlot, sapi-sapi ditempatkan di kandang khusus dan diberi pakan berenergi tinggi untuk mempercepat proses penggemukan.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Pengolahan Susu</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Selain usaha penggemukan sapi potong, beberapa perusahaan seperti PT. Global Dairi Alami juga bergerak dalam pengolahan susu sapi perah. Industri susu perah merupakan salah satu subsektor yang memiliki prospek cerah mengingat permintaan terhadap produk susu olahan terus meningkat, baik di dalam negeri maupun untuk pasar ekspor. Produk olahan susu seperti susu segar, keju, yoghurt, dan mentega menjadi komoditas bernilai tambah yang sangat diminati di pasar domestik maupun internasional. Tantangan dalam subsektor ini termasuk dalam hal menjaga kualitas susu, terutama dari segi kebersihan dan keamanan pangan.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Pembiakan Bebek</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Pembiakan bebek atau usaha hatchery dan breeding farm untuk bebek juga muncul dalam dokumen ini, misalnya melalui PT. Mitra Bebek Persada. Bebek merupakan komoditas alternatif yang penting, terutama untuk produksi daging bebek dan telur itik yang juga cukup populer di kalangan konsumen Indonesia. Permintaan terhadap bebek, terutama untuk konsumsi daging, terus tumbuh, didorong oleh preferensi konsumen yang beragam serta peningkatan popularitas produk-produk kuliner yang berbasis bebek.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Komoditas Utama dalam Industri Peternakan</span></strong></li>
</ol>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Sektor peternakan di Indonesia menghasilkan berbagai komoditas penting yang memiliki nilai ekonomi besar. Beberapa komoditas utama yang dikelola oleh perusahaan dalam dokumen ini meliputi:</span></p>
<ol class="decimal_type" style="list-style-type: decimal;margin-left: 8px;">
    <li><strong><span style='line-height:107%;font-size:16px;'>Unggas/DOC</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;DOC (Day-Old Chick) atau anak ayam usia sehari merupakan salah satu komoditas unggulan yang diproduksi oleh sebagian besar perusahaan yang tercantum dalam dokumen ini. DOC adalah dasar dari seluruh rantai produksi daging unggas. Dengan pertumbuhan konsumsi daging ayam di Indonesia, kebutuhan akan DOC terus meningkat, menciptakan peluang besar bagi para pemain dalam industri ini. DOC juga diekspor ke beberapa negara tetangga yang memiliki permintaan tinggi terhadap anak ayam untuk peternakan lokal mereka.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Sapi Potong dan Daging Sapi</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Selain unggas, sapi potong juga merupakan komoditas yang sangat penting, terutama karena daging sapi memiliki harga yang relatif tinggi dan permintaan yang stabil. Dalam dokumen ini, beberapa perusahaan feedloter khusus berfokus pada penggemukan sapi potong untuk menghasilkan daging berkualitas tinggi. Dengan adanya peningkatan konsumsi daging sapi di kalangan masyarakat kelas menengah dan atas di Indonesia, usaha feedloter menjadi sangat strategis.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Susu dan Produk Olahan Susu</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;Industri susu, khususnya produk olahan susu seperti susu cair, yoghurt, dan keju, menjadi bagian dari sektor peternakan yang terus berkembang. Perusahaan seperti PT. Global Dairi Alami berfokus pada pengolahan susu dan produk turunannya. Permintaan akan produk-produk susu olahan terus meningkat, seiring dengan kesadaran masyarakat akan pentingnya nutrisi yang terkandung dalam susu, serta gaya hidup modern yang mendorong konsumsi produk olahan susu.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Bebek/DOD</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;DOD (Day-Old Duck) atau anak bebek juga merupakan komoditas yang penting bagi beberapa perusahaan. Daging bebek dan telur itik adalah dua produk utama dari pembiakan bebek, yang semakin diminati baik di pasar domestik maupun internasional. Beberapa perusahaan seperti PT. Mitra Bebek Persada memanfaatkan peluang ini untuk memenuhi permintaan pasar.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>Diversifikasi Usaha dalam Industri Peternakan</span></strong></li>
</ol>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Salah satu tren yang jelas dari dokumen ini adalah diversifikasi usaha oleh perusahaan-perusahaan peternakan di Indonesia. Banyak perusahaan tidak hanya fokus pada satu jenis usaha atau komoditas, tetapi mengelola berbagai lini usaha untuk memaksimalkan pendapatan dan mengurangi risiko. Sebagai contoh:</span></p>
<ol style="list-style-type: decimal;margin-left: 8px;">
    <li><strong><span style='line-height:107%;font-size:16px;'>PT. Charoen Pokphand Indonesia</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;tidak hanya bergerak dalam bidang breeding farm dan hatchery, tetapi juga terlibat dalam RPU dan pengolahan karkas ayam. Hal ini menunjukkan bahwa perusahaan ini menguasai rantai pasokan dari hulu hingga hilir, memungkinkan mereka untuk lebih efisien dalam hal produksi dan distribusi.</span></li>
    <li><strong><span style='line-height:107%;font-size:16px;'>PT. Leong Ayamsatu Primadona</span></strong><span style='line-height:107%;font-size:16px;'>&nbsp;adalah contoh lain dari perusahaan yang mengoperasikan berbagai usaha, mulai dari breeding farm, hatchery, hingga broiler, yang mencerminkan strategi diversifikasi untuk memenuhi berbagai segmen pasar dan meningkatkan daya saing.</span></li>
</ol>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Diversifikasi ini merupakan strategi yang umum dalam industri dengan risiko tinggi seperti peternakan, di mana fluktuasi harga komoditas, serangan penyakit, dan faktor cuaca dapat mempengaruhi produksi.</span></p>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Selain data jumlah pengusaha di bidang peternakan yang ada di Kawasan Kabupaten Subang, tim juga mendapatkan data tambahan terkait produksi daging sapi dan ayam khususnya di Kabupaten Subang. Dimana Pada tahun 2023, produksi daging sapi mencapai angka yang cukup besar yaitu sebanyak 1.310.857 kilogram. Sementara itu, daging kerbau hanya diproduksi dalam jumlah yang jauh lebih kecil, yaitu 5.145 kilogram. Di sektor daging kambing, tercatat produksi sebesar 90.380 kilogram, sedangkan produksi daging domba lebih tinggi, yakni 875.243 kilogram. Untuk daging unggas, produksi daging ayam buras atau ayam lokal mencapai 1.595.796 kilogram, dan daging ayam ras mendominasi dengan jumlah yang sangat signifikan, yaitu 71.132.470 kilogram. Selain itu, produksi daging itik juga terhitung cukup besar dengan total sebanyak 457.148 kilogram.</span></p>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Dalam kategori produksi telur, telur ayam buras diproduksi sebanyak 3.697.407 kilogram, sementara telur ayam ras mencapai angka produksi 2.374.178 kilogram. Telur itik diproduksi lebih banyak dibandingkan kedua jenis telur ayam tersebut, dengan jumlah mencapai 4.588.528 kilogram.</span></p>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Untuk produksi susu, tercatat susu sapi diproduksi dalam jumlah yang sangat signifikan yaitu sebanyak 21.301.688 kilogram. Angka-angka ini menunjukkan skala besar dari produksi peternakan di berbagai komoditas ternak yang beragam pada tahun tersebut, dengan ayam ras sebagai komoditas unggulan dalam sektor daging dan telur, serta susu sapi sebagai sumber utama produk susu.</span></p>
