<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Selain data terkait produksi hasil peternakan produksi dalam Kabupaten Subang. Juga didapatkan data terkait dengan data pemasukan dan pengeluaran komoditas ternak dan data pemasukan dan pengeluaran komoditas unggas khusus tahun 2023.&nbsp;</span></p>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Pemasukan ternak kambing sepanjang tahun 2023 mencapai total <strong>26.309 ekor</strong>. Ternak kambing ini berasal dari berbagai daerah di sekitar Subang, termasuk Purwakarta, Indramayu, Sumedang, dan Bandung Barat. Dari segi waktu, <strong>April</strong> menjadi bulan dengan pemasukan tertinggi, yaitu sebanyak <strong>503 ekor</strong> kambing. Di sisi lain, <strong>Juli</strong> tercatat sebagai bulan dengan pemasukan terendah, hanya <strong>177 ekor</strong>. Fluktuasi pemasukan ini bisa disebabkan oleh siklus ternak atau permintaan pasar yang berfluktuasi seiring dengan kebutuhan masyarakat, misalnya menjelang hari raya keagamaan. Adanya variasi daerah asal ternak menunjukkan bahwa Kabupaten Subang merupakan pusat distribusi ternak yang menerima pasokan dari berbagai wilayah di Jawa Barat dan sekitarnya. Pada bulan-bulan tertentu, seperti <strong>Agustus</strong> dan <strong>November</strong>, tercatat juga pemasukan dari daerah di luar Jawa Barat seperti Jawa Tengah, Jawa Timur, dan bahkan dari luar pulau seperti Lampung.</span></p>
<p><span style='font-size:16px;'><br>&nbsp;</span></p>
