<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Untuk ternak domba, total pemasukan pada tahun 2023 mencapai <strong>10.536 ekor</strong>. Mirip dengan kambing, domba juga berasal dari daerah-daerah seperti Subang, Bandung, Sumedang, Indramayu, dan Purwakarta. Bulan <strong>April</strong> juga menjadi puncak pemasukan domba, dengan <strong>491 ekor</strong>, sementara <strong>Juli</strong> menjadi bulan dengan jumlah pemasukan terendah, yaitu <strong>245 ekor</strong>. Pemasukan ternak domba menunjukkan pola yang sama dengan ternak kambing, di mana Subang menjadi tujuan utama dari berbagai wilayah pemasok. Namun, dibandingkan kambing, jumlah pemasukan domba lebih rendah, yang mungkin mencerminkan perbedaan tingkat permintaan atau ketersediaan pasokan domba dibandingkan kambing.</span></p>
