<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;text-indent:36.0pt;'><span style='font-size:16px;line-height:107%;'>Data pemasukan unggas di Kabupaten Subang sepanjang tahun 2023 menunjukkan variasi signifikan dalam jumlah dan jenis unggas yang masuk setiap bulannya. Pemasukan didominasi oleh ayam ras pedaging (broiler), ayam buras, dan itik, dengan total pemasukan mencapai 9,257,520 ekor unggas. Pemasukan tertinggi terjadi pada bulan November dengan 11,500 ekor ayam buras dan 616,500 ekor ayam ras. Bulan-bulan lain seperti Januari dan Maret juga mencatat pemasukan yang cukup tinggi, dengan total unggas masing-masing sebesar 1,327 dan 1,152 ekor ayam buras, serta jutaan ekor ayam ras. Distribusi geografis unggas yang masuk mencakup berbagai wilayah di Jawa Barat, seperti Purwakarta, Indramayu, Sumedang, Bandung, Karawang, Bogor, Ciamis, dan Cianjur, serta Banten dan Jawa Timur.</span></p>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;text-indent:36.0pt;'><span style='font-size:16px;line-height:107%;'>Analisis bulanan menunjukkan fluktuasi dalam pemasukan unggas yang kemungkinan besar dipengaruhi oleh faktor musiman dan permintaan pasar. Bulan April mencatat jumlah pemasukan ayam buras yang sangat tinggi yaitu 11,489 ekor, yang mungkin terkait dengan peningkatan permintaan selama periode tersebut. Selain itu, bulan September dan Oktober juga menunjukkan lonjakan dengan pemasukan ayam buras masing-masing 7,550 dan 8,500 ekor, serta ayam ras mencapai 164,250 dan 389,500 ekor. Fluktuasi ini dapat menunjukkan adanya pola permintaan pasar yang lebih tinggi pada kuartal akhir tahun.</span></p>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;text-indent:36.0pt;'><span style='font-size:16px;line-height:107%;'>Dari segi komoditas, ayam ras pedaging mendominasi pemasukan unggas, sementara ayam buras dan itik menyumbang jumlah yang lebih kecil tetapi tetap signifikan. Pemasukan itik mencapai puncaknya pada bulan September dengan 1,060 ekor, yang mencerminkan dinamika permintaan terhadap unggas jenis ini. Bulan Desember mencatat pemasukan ayam buras sebanyak 7,075 ekor, yang menunjukkan stabilitas pasar menjelang akhir tahun. Secara keseluruhan, Kabupaten Subang memainkan peranan penting sebagai pusat pemasukan unggas yang tidak hanya memenuhi kebutuhan lokal tetapi juga mendistribusikan unggas ke berbagai wilayah di Jawa Barat dan sekitarnya. Data ini memberikan wawasan berharga bagi pengambilan keputusan strategis dalam perencanaan produksi, distribusi, dan pemasaran unggas di masa depan. Analisis ini juga menunjukkan pentingnya adaptasi terhadap fluktuasi musiman dan dinamika pasar untuk memastikan kelangsungan dan efisiensi dalam pengelolaan pemasukan unggas.</span></p>
