<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Data pengeluaran unggas di Kabupaten Subang sepanjang tahun 2023 menunjukkan dinamika distribusi yang signifikan dengan fokus utama pada ayam ras pedaging (broiler), ayam buras, dan itik. Jumlah total unggas yang dikeluarkan selama periode ini mencapai 14,446,625 ekor ayam ras dan 72,791 ekor ayam buras. Jumlah telur yang dikeluarkan mencapai 3,066,000 butir. Pengeluaran tertinggi terjadi pada bulan Oktober dengan angka luar biasa 153,050 ekor ayam buras, yang menandai puncak aktivitas distribusi selama tahun tersebut. Bulan Juli dan November juga mencatat jumlah pengeluaran yang tinggi, masing-masing dengan 9,621 dan 8,254 ekor ayam buras serta lebih dari 1,300,000 ekor ayam ras.</span></p>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Fluktuasi bulanan dalam pengeluaran unggas menunjukkan adanya pola permintaan yang bervariasi sepanjang tahun. Bulan April dan Juni juga menampilkan pengeluaran ayam ras yang signifikan, masing-masing mencapai 1,705,350 dan 1,106,215 ekor. Angka-angka ini menandakan lonjakan permintaan yang mungkin terkait dengan perayaan atau kegiatan musiman tertentu. Secara keseluruhan, pengeluaran unggas lebih tinggi pada paruh kedua tahun, dengan peningkatan signifikan pada bulan Juli hingga Desember.</span></p>
<p style='margin-right:0cm;margin-left:0cm;font-size:16px;font-family:"Aptos",sans-serif;margin-top:0cm;margin-bottom:8.0pt;font-size:11.0pt;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Distribusi geografis pengeluaran mencakup berbagai wilayah utama di Jawa Barat, termasuk Subang, Indramayu, Purwakarta, Bandung, Karawang, Bekasi, Bogor, serta beberapa daerah lain seperti Jakarta dan Banten. Ini menunjukkan bahwa Kabupaten Subang berperan sebagai pusat utama distribusi unggas ke berbagai daerah di wilayah tersebut.</span></p>
<p><span style='font-size:16px;'>Pola distribusi dan jumlah pengeluaran unggas ini penting untuk dianalisis lebih lanjut dalam konteks perencanaan strategis dan operasional. Data ini memberikan wawasan tentang kebutuhan logistik, pola permintaan pasar, dan kemungkinan tantangan dalam pengelolaan suplai unggas. Melalui analisis yang mendalam, dapat diidentifikasi waktu puncak permintaan, yang dapat digunakan untuk meningkatkan efisiensi distribusi dan penyesuaian strategi pemasaran guna memaksimalkan keuntungan serta menjaga stabilitas pasokan unggas di pasar regional.</span></p>
